  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0114447 includes biological,
  chemical, discrete sample, physical and profile data collected from USCGC POLAR
  SEA in the North Greenland Sea from 1993-07-18 to 1993-08-20 and retrieved during
  cruise CARINA/32L919930718 and NEWP93. These data include AMMONIUM, BACTERIA - BACTERIAL
  DENSITY, CHLOROPHYLL A, DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED INORGANIC CARBON,
  DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PARTICULATE ORGANIC
  CARBON, PARTICULATE ORGANIC NITROGEN, PHAEOPHYTIN, PHOSPHATE, Partial pressure (or
  fugacity) of carbon dioxide, Potential temperature (theta), SALINITY, SILICATE,
  Tritium (Hydrogen isotope) and WATER TEMPERATURE. The instruments used to collect
  these data include CTD and bottle. These data were collected by C. Neill and B.
  Schneider of Commonwealth Scientific and Industrial Research Organization, Douglas
  Wallace of Universitat Kiel; Institut Fur Meereskunde; Forschungsbereich Marine
  Biogeochemie and Kenneth Johnson and J. Deming [affiliation unknown] as part of
  the CARINA/32L919930718 data set.nnThe CARINA (CARbon dioxide IN the Atlantic Ocean)
  data synthesis project is an international collaborative effort of the EU IP CARBOOCEAN,
  and U.S. partners. It has produced a merged internally consistent data set of open
  ocean subsurface measurements for biogeochemical investigations, in particular,
  studies involving the carbon system. The original focus area was the North Atlantic
  Ocean, but over time the geographic extent expanded and CARINA now includes data
  from the entire Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"owner_org\":
